import logo from "../../assets/logo.png";
import user from "../../assets/instants.jpg";
import "../CSS/farm.css";
import axios from "axios";

class FHome extends Component {
  constructor(){
 super();
  this.state={

    data:[]
  }
}

componentDidMount(){
  //
  fetch('http://newsapi.org/v2/top-headlines?country=us&apiKey=0976e1460f954e439dc6f1938e0a096f').  
  then((Response)=>Response.json()).
  then((findresponse=>
    {
      console.log(findresponse.articles)
      this.setState({
        data:findresponse.articles
      })
    }))
}

render() {

    return (

         <div className="product-top">
           {
             this.state.data.map((dynamicData,key)=>
             <div>
               <table>
                   <th> {dynamicData.title}</th>
                   <th>{dynamicData.author}</th>
                 <th>{dynamicData.content}</th>
                <th>{ dynamicData.description }</th>
                 </table>

             </div>
             )
           }
           </div>


    );
  }
}

export default FHome;
